        <div className='img_div'>
            <img src={img} className='img' alt='Thumb_img'/>
            <span className='durationn'>{duration}</span>        
        </div>

        <div className='body'>
            <p><b>{title}</b></p>
            <p>{channel}</p>

            <div>
                <p>{views} â€¢ {timestamp}</p>
            </div>

        </div>
    </div>
  )
}

export default Siderow
